using Core.Entities;
using Core.Interfases;
using Core.Services;
using Moq;
using System.Collections.Generic;
using System.Threading.Tasks;
using Xunit;

namespace Tests.UnitTests;

public class PictureServiceTests
{
    [Fact]
    public async Task GetPictureById_ReturnsPicture_WhenCityExists()
    {
        // Arrange
        var mockPictureRepository = new Mock<IPictureRepository>();
        var picture = new Picture { Id = 1, RegionId = 1, Name = "Andalucia_1", ImageBase64 = "data:image/jpeg;base64," };
        mockPictureRepository.Setup(repo => repo.GetByIdAsync(1)).ReturnsAsync(picture);

        var pictureService = new PictureService(mockPictureRepository.Object);

        // Act
        var result = await pictureService.GetPictureById(1);

        // Assert
        Assert.NotNull(result);

        Assert.Equal(1, result.Id);
        Assert.Equal("Andalucia_1", result.Name);
        Assert.Equal(1, result.RegionId);
        Assert.Equal("data:image/jpeg;base64,:image/jpeg;base64,", result.ImageBase64);
    }

    [Fact]
    public async Task GetPicturesByRegion_ReturnsPictures_WhenPicturesExist()
    {
        // Arrange
        var mockPictureRepository = new Mock<IPictureRepository>();
        var pictures = new List<Picture>
        {
            new Picture { Id = 1, RegionId = 1, ImageBase64 = "data:image/jpeg;base64,", Name = "Andalucia_1" },
            new Picture { Id = 2, RegionId = 1, ImageBase64 = "data:image/jpeg;base64,", Name = "Andalucia_2" }
        };
        mockPictureRepository.Setup(repo => repo.GetAllAsync()).ReturnsAsync(pictures);

        var pictureService = new PictureService(mockPictureRepository.Object);

        // Act
        var result = await pictureService.GetAllPictures();

        // Assert
        Assert.NotNull(result);
        Assert.Equal(2, result.Count()); // Esperamos dos ciudades
        Assert.Contains(result, c => c.Name == "Andalucia_1");
        Assert.Contains(result, c => c.Name == "Andalucia_2");
    }
}
